import React, { Component } from 'react' 
import { 
    SubMenuItem
} from './styled-components'

class SubMenu extends Component {
     // State 
     state = {
        active: false
     }

     // Render 
     render () {
         return (
             <React.Fragment>
                 <SubMenuItem style={{
                      top: "10rem",
                      left: "45vw",
                      zIndex:`${this.state.active ? '4' : '-1'}`
                 }}/>
             </React.Fragment>
         )
     }
}

export default SubMenu
